import React, { Component } from 'react';
import './Header.css';
import logo from '../assets/logo.png';
import Link from 'react-router-dom';

const HeaderItem = (prop) => {
  return (
    <div className="header-item text-center d-none d-lg-block h2 col">
      {prop.name}
    </div>
  );
}

const Logo = () => {
  return (
    <div className="logo text-center col">
      <img src={logo} height="220px" width="180px" alt="logo" />
    </div>
  )
}

class Header extends Component {
  render() {
    return (
      <div className="navigation row mx-0">
       <div className="header-item text-center d-none d-lg-block h2 col">
        <Link to={'/'}> Artwork </Link>
       </div>
        <HeaderItem name="Photo" /> 
        <Logo /> 
        <HeaderItem name="About" /> 
        <HeaderItem name="Contact" />  
      </div>
    );
  }
}

export default Header;
